    <body>
        <canvas id="canvas" width="500" height="500"></canvas>
        
        <script type="text/javascript">
            var minLat = Math.min.apply(Math, locations.map(function(el) { return parseFloat(el['lat']); }));
            var maxLat = Math.max.apply(Math, locations.map(function(el) { return parseFloat(el['lat']); }));
            var minLng = Math.min.apply(Math, locations.map(function(el) { return parseFloat(el['lng']); }));
            var maxLng = Math.max.apply(Math, locations.map(function(el) { return parseFloat(el['lng']); }));
            
            function sketchProc(processing) {  
                // Override draw function, by default it will be called 60 times per second  
                processing.setup = function() {
                    processing.size(500, 500);
                }
                
                processing.draw = function() {
                    processing.background(224);
                    
                    for (var index in locations) {
                        var loc = locations[index];
                        
                        processing.ellipse(
                            processing.map(parseFloat(loc['lng']), minLng, maxLng, 25, 475), 
                            processing.map(parseFloat(loc['lat']), minLat, maxLat, 475, 25), 
                            2, 2);
                    }
                };  

            }
            
            var canvas = document.getElementById("canvas");
            var p = new Processing(canvas, sketchProc);
        </script>
